}
if(rects[aRect].x==finish.x&&rects[aRect].y==finish.y){
alert("Уровень пройден")
rstGame();
};
requestAnimationFrame(draw);
}
draw();
window.addEventListener("keydown",function(key){
switch(key.code){
case "Space":{aRect++;if(aRect>rects.length-1)aRect=0;break;}
case "ArrowLeft":{if(rects[aRect].hor){rects[aRect].x0=rects[aRect].x;rects[aRect].x-=step;}break;}
case "ArrowRight":{if(rects[aRect].hor){rects[aRect].x0=rects[aRect].x;rects[aRect].x+=step;}break;}
case "ArrowUp":{if(rects[aRect].ver){rects[aRect].y0=rects[aRect].y;rects[aRect].y-=step;}break;}
case "ArrowDown":{if(rects[aRect].ver){rects[aRect].y0=rects[aRect].y;rects[aRect].y+=step;}break;}
}
});
</script>
